              <div class="glue-grid"> 
                <div class="glue-grid__col glue-grid__col--span-11 glue-grid__col--span-11-lg"> 
                  <h3 class="glue-headline glue-headline--headline-3 glue-mod-spacer-4-bottom incentive-offer"> Para te ajudar a começar com o Google Ads, nós te daremos R$1200,00 de crédito publicitário quando você gastar R$1200,00. </h3><a aria-label="Reivindique esta oferta" class="glue-button glue-button--high-emphasis claim-offer glue-mod-spacer-3-bottom" data-gtm-id="home-sxgyincentivestartnow-modal" href="#signup?subid=br-pt-ha-awa-bk-c-scru!o3~EAIaIQobChMIv4321InX_gIVDCeRCh0M_AZ-EAAYASAAEgKvBPD_BwE~140965879569~aud-780873439152%3Akwd-12340353~17334788550~613759371005_latam-ha" id="incentive-cta" rel="noopener">Reivindique esta oferta</a> 
                  <div class="coupon-terms"> 
                    <h4 class="glue-headline glue-headline--headline-4 glue-mod-spacer-3-bottom"> Termos e condições desta oferta: </h4> 
                    <ol> 
                      <li ng-if="octoVars.firstPoint">Oferta disponível apenas enquanto durarem os estoques. </li> 
                      <li ng-if="octoVars.secondPoint">Oferta disponível apenas para novos anunciantes com endereço de cobrança no Brasil. Um código promocional por anunciante. </li> 
                      <li ng-if="octoVars.thirdPoint">Para ativar esta oferta: Clique no botão ou link associado a esta oferta para que o código promocional seja aplicado automaticamente à sua primeira conta do Google Ads. O código promocional deve ser aplicado à sua primeira conta do Google Ads em até 14 dias após a exibição da primeira impressão de anúncio dessa conta. </li> 
                      <li ng-if="octoVars.fourthPoint">Para receber o crédito: depois de inserir o código promocional na conta do Google Ads, suas campanhas de publicidade precisam acumular pelo menos R$ 1.200 (não incluindo tributos ou taxas aplicáveis) de gastos em 60 dias. Realizar um pagamento nesse valor não é suficiente. Os gastos de publicidade começam a ser somados para chegar ao valor de R$ 1.200 após a aplicação do código promocional. </li> 
                      <li ng-if="octoVars.fifthPoint">Depois que os passos 3 e 4 forem concluídos, o crédito normalmente será aplicado em 5 dias ao Resumo de faturamento de sua conta do Google Ads. </li> 
                      <li ng-if="octoVars.sixthPoint">O crédito expira 60 dias após ser aplicado em sua conta. </li> 
                      <li ng-if="octoVars.seventhPoint">O crédito aplica-se apenas a custos de publicidade futuros. O crédito não pode ser aplicado a custos acumulados antes de o código promocional ser inserido em sua conta do Google Ads. </li> 
                      <li ng-if="octoVars.eightPoint">Você não receberá uma notificação quando o crédito em sua conta do Google Ads acabar e todos os custos de publicidade adicionais serão cobrados de acordo com sua forma de pagamento. Se não quiser continuar anunciando, você pode pausar ou excluir suas campanhas a qualquer momento. </li> 
                      <li ng-if="octoVars.ninthPoint">Sua conta deve ser faturada com sucesso pelo Google Ads e permanecer em situação regular para permanecer qualificada para usar o crédito. </li> 
                      <li ng-if="octoVars.tenthPoint">Os termos e condições completos podem ser encontrados aqui <a href="#intl/pt-BR_br/ads/coupons/terms/?subid=br-pt-ha-awa-bk-c-scru!o3~EAIaIQobChMIv4321InX_gIVDCeRCh0M_AZ-EAAYASAAEgKvBPD_BwE~140965879569~aud-780873439152%3Akwd-12340353~17334788550~613759371005" ng-if="octoVars.tenthPointLinkText" rel="noopener noreferrer" target="_blank">#intl/pt-BR_br/ads/coupons/terms/</a> . 
                      </li>   
                    </ol> 
                  </div> 
